import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Redirect } from 'react-router-dom'
import './App.css';
import './user/pages/Users'
import Users from './user/pages/Users';

const App = () => {
  return <Router>
      <Route path="/" exact>
        <Users />
      </Route>
      <Redirect/>
    </Router>;
}

export default App;
